en.value:
&lt;p&gt;Two statements are given followed by three conclusions numbered I, II and III. Assuming the statements to be true, even if they seem to be at variance with commonly known facts, decide which of the conclusions logically follow(s) from the statements.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Comments&lt;/strong&gt;:&lt;/p&gt;

&lt;p&gt;All rulers are machines.&lt;/p&gt;

&lt;p&gt;Some machines are costly items.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Conclusions&lt;/strong&gt;:&lt;/p&gt;

&lt;p&gt;I. Some rulers are costly items.&lt;/p&gt;

&lt;p&gt;II. Some costly items are machines.&lt;/p&gt;
III. All costly items are machines.

hn.value:
&lt;p&gt;दो कथन और तीन निष्कर्ष I, II और III दिए गए हैं। कथनों को सत्य मानना है &amp;nbsp;भले ही वे आम तौर पर ज्ञात तथ्यों को नजरअंदाज करते हों और फिर तय कीजिए कि कौन सा निष्कर्ष तार्किक रूप से कथन का अनुसरण करता है।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन&lt;/strong&gt;:&lt;/p&gt;

&lt;p&gt;सभी रूलर मशीन हैं।&lt;/p&gt;

&lt;p&gt;कुछ मशीनें महंगी वस्तुएं हैं।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;निष्कर्ष&lt;/strong&gt;:&lt;/p&gt;

&lt;p&gt;I. कुछ रूलर महंगी वस्तुए हैं।&lt;/p&gt;

&lt;p&gt;II. कुछ महँगी वस्तुएँ मशीन हैं।&lt;/p&gt;
III. सभी महंगी वस्तुएं मशीनें हैं।

